package cn.armylife.member.domain;import java.util.Map;public class WXtemplate {    private String openid;    private String first;    private String remark1;    private String template;    private String url;    public String getOpenid() {        return openid;    }    public void setOpenid(String openid) {        this.openid = openid;    }    public String getFirst() {        return first;    }    public void setFirst(String first) {        this.first = first;    }    public String getRemark1() {        return remark1;    }    public void setRemark1(String remark1) {        this.remark1 = remark1;    }    public String getTemplate() {        return template;    }    public void setTemplate(String template) {        this.template = template;    }    public String getUrl() {        return url;    }    public void setUrl(String url) {        this.url = url;    }    public Map<String,String> Key;    public Map<String, String> getKey() {        return Key;    }    public void setKey(Map<String, String> key) {        Key = key;    }}